import React from 'react';
import DataForm from '../components/DataForm/DataForm';
import NavBar from '../components/NavBar/NavBar';

const DataFormPage = ({ onSubmit }) => {
  return (
    <div>
      <NavBar></NavBar>
      <h1>Data Form</h1>
      <DataForm onSubmit={onSubmit} />
    </div>
  );
};

export default DataFormPage;
